const ContetntItem = () => {
    const href = "/";
  return (
    <div className="item">
      <a href={href}>
        <img src={url} className="item-img" alt="عکس فیلم"/>
        <div>
          <p className="item-header"></p>
          <div className="item-text">
            <span className="item-icon">
              <StarIcon />
            </span>
            <span className="item-rate"></span>
          </div>
          <div>
            <img src={IDMB} alt="IDMB" />
            <span className="item-idmb"></span>
          </div>
        </div>
      </a>
    </div>
  );
};
export default ContetntItem;
